[Form]
public class InventJournalArchiveForm extends FormRun
{
    private InventDimCtrl_Frm_ActiveRightClick   inventDimFormSetup;
    private FormGroupControl                     lastJournalTypeGroup;
    private FormGroupControl                     lastInventDimGroup;

}

public void enableControls(InventJournalType _inventJournalType)
{
    if (lastJournalTypeGroup && lastInventDimGroup)
    {
        lastJournalTypeGroup.visible(false);
        lastInventDimGroup.visible(false);
    }

    switch (_inventJournalType)
    {
        case InventJournalType::Movement:
            lastJournalTypeGroup = InventJournalMovement;
            lastInventDimGroup = DimensionsGroup_common;
            break;

        case InventJournalType::LossProfit:
            lastJournalTypeGroup = InventJournalLossProfit;
            lastInventDimGroup = DimensionsGroup_common;
            break;

        case InventJournalType::Transfer:
            lastJournalTypeGroup = InventJournalTransfer;
            lastInventDimGroup = DimensionsGroup_changeDim;
            break;

        case InventJournalType::BOM:
            lastJournalTypeGroup = InventJournalBOM;
            lastInventDimGroup = DimensionsGroup_common;
            break;

        case InventJournalType::Count:
            lastJournalTypeGroup = InventJournalCount;
            lastInventDimGroup = DimensionsGroup_common;
            break;

        case InventJournalType::project:
            // Do not archive for now.
            break;

        case InventJournalType::TagCounting:
            // Not support.
            break;

        case InventJournalType::Asset:
            lastJournalTypeGroup = InventJournalAsset;
            lastInventDimGroup = DimensionsGroup_common;
            break;

        case InventJournalType::OwnershipChange:
            lastJournalTypeGroup = InventJournalOwnershipChange;
            lastInventDimGroup = DimensionsGroup_changeDim;
            break;
    }

    lastJournalTypeGroup.visible(true);
    lastInventDimGroup.visible(true);
}

[Hookable(false)]
public void init()
{
    super();

    if (  (element.args().callerName() == formstr(InventJournalArchiveTransFormPart)
        && element.args().record() is InventJournalArchiveTrans))
    {
        InventJournalArchiveTrans archiveTrans = element.args().record();
        var archiveJobSourceLink = ArchiveServiceJobDetailsView::findForSourceLink(archiveTrans);

        QueryBuildDataSource qbds = inventJournalTableHistory_ds.query().dataSourceTable(tableNum(InventJournalTableHistory));
        qbds.addRange(fieldNum(InventJournalTableHistory, ArchiveServiceJobId)).value(SysQuery::value(archiveJobSourceLink.ArchiveServiceJobId));
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);

    #SysSystemDefinedButtons
    FormCommandButtonControl attachButton = this.control(this.controlId(#SystemDefinedAttachButton)) as FormCommandButtonControl;
    attachButton.visible(false);
}

[Hookable(false)]
internal void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm  inventDimParm;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init :
            InventDimSetupGrid::initInventDimParmInventTrans(inventDimParm);

            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_ActiveRightClick::newFromForm(element);
            }

            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetup.formSetControls(true);
    }
}

public int active()
{
    int ret = super();

    if (ret)
    {
        element.enableControls(inventJournalTableHistory.JournalType);
        element.updateDesign(InventDimFormDesignUpdate::Init);
    }

    return ret;
}

edit InventAssetJournalType editTransactionType(
    boolean _set,
    InventJournalTransHistory _inventJournalTransHistory,
    InventAssetJournalType _transType)
{
    InventAssetJournalType transType = _transType;

    if (_set)
    {
        if (transType == InventAssetJournalType::AcquisitionAdjustment)
        {
            _inventJournalTransHistory.AssetTransType = AssetTransTypeJournal::AcquisitionAdj;
        }
        else
        {
            _inventJournalTransHistory.AssetTransType = AssetTransTypeJournal::Acquisition;
        }
    }
    else
    {
        if (_inventJournalTransHistory.AssetTransType == AssetTransTypeJournal::AcquisitionAdj)
        {
            transType = InventAssetJournalType::AcquisitionAdjustment;
        }
        else
        {
            transType = InventAssetJournalType::Acquisition;
            _inventJournalTransHistory.AssetTransType = AssetTransTypeJournal::Acquisition;
        }
    }

    return transType;
}

public void lookup()
{
    AssetBook::lookupOpenBookIdForAsset(this,
        inventJournalTransHistory.AssetId,
        true,
        CurrentOperationsTax::Current,
        curExt(),
        true); // only Current
}
